import "./trip_style.css";

export default function TripData({src,title,text}){
    return(
        <div className="t-card">
            <div className="t-image">
                <img alt="simple-image" src={props.src}/>
            </div>
            <h4>{props.title}</h4>
            <p>{props.text}</p>
        </div>
    );
}
